class Solution:
    def orderOfLargestPlusSign(self, N, mines):
        """
        :type N: int
        :type mines: List[List[int]]
        :rtype: int
        """
        a = [[int(N/2)]*N for _ in range(N)]
        for m in range(1,N-1):
        	for n in range(1,N-1):
        		a[m][n] = min(m, n, N-1-m, N-1-n)+1
        for loc in mines:
        	i, j = loc[0], loc[1]
        	a[i][j] = 0
        	for x in range(N):
        		if a[i][x] > abs(x-j):
        			a[i][x] = abs(x-j)
        		if a[x][j] > abs(x-i):
        			a[x][j] = abs(x-i)
        result = map(max, a)
        return max(result)


